import React from "react";
import ReactDOM from "react-dom";
// import './navbar.css';
// import './aboutus.css';
import "./header.css";
import { Button } from "react-bootstrap";
import Link from "@material-ui/core/Link";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faFacebook,
  faTwitter,
  faInstagram,
  faLinkedin,
} from "@fortawesome/free-brands-svg-icons";

let isValid = true;
const Header=()=>{
    React.useEffect(() => {
        try{
          const userinfo=localStorage.getItem('userinfo');
    
          console.log(userinfo);
    
          if(userinfo)
          {
            isValid=false;
          }
          else
          {
            isValid=true;
          }
    
          
      }catch(err){
          console.log(err);
          
          
      }
        
      }, []);
    
    return (
        <div>
            <div className="nav">
  <ul>
      
       
    <li>
    <Link href="/search" variant="body2">
        Home
      </Link>
    </li>
    <li>
    <Link href="/signup" variant="body2">
        Register
      </Link>
    </li>
    <li>
    <Link href="/aboutus" variant="body2">
        About Me
      </Link>
    </li>
    {/* <li>
    <Link href="/feedback" onClick={localStorage.removeItem("userinfo")} variant="body2">
                     LogOut
                     </Link>
      </li> */}
  </ul>
</div>

        </div>
    )
};
export default Header;
